window.bookSummaryJSON = "<p>Padawan Reath Silas is being sent from the cosmopolitan galactic capital of Coruscant to the undeveloped frontier - and he couldn't be less happy about it. He'd rather stay at the Jedi Temple, studying the archives. But when the ship he's traveling on is knocked out of hyperspace in a galactic-wide disaster, Reath finds himself at the center of the action. The Jedi and their traveling companions find refuge on what appears to be an abandoned space station. But then strange things start happening, leading the Jedi to investigate the truth behind the mysterious station, a truth that could end in tragedy....</p>"; 
